import React from "react";
import Header  from "./Header";
import emoji from './emojipedia';
import emojis from './emoji';


function App() {
  return (
        <div>
        <Header />
    <div className="dictionary">


    {emoji.map((a)=>{
      return (
       <emojis 
         emoji={a.emoji}
         name={a.name}
         meaning={a.meaning}
      />
      )
    })}
    </div>

    </div>
  )
}

export default App;
